p.MsoNormal, li.MsoNormal, div.MsoNormal
	{margin:0cm;
	font-size:12.0pt;
	font-family:"Aptos",sans-serif}
span.EmailStyle17
	{font-family:"Calibri",sans-serif;
	color:windowtext}
.MsoChpDefault
	{}
@page WordSection1
	{margin:3.0cm 2.0cm 3.0cm 2.0cm}
div.WordSection1
	{}
-->
</style>
</head>
